import React from 'react'

function Friends(props){
  return(
    <div>
      <span>
        {props.friendsList.map((items,index)=>(
        <div key={index}>
        {items} <button>Delete</button>
        </div>
        ))}
      </span>
    </div>
  )

}


export default Friends;
